import React from 'react';
import { Link } from 'react-router-dom';

const AptitudeLearning = () => {
  return (
    <div className="p-6 bg-gray-100 min-h-screen">
      <h1 className="text-4xl font-bold text-center mb-8">Aptitude Learning</h1>
      <div className="flex flex-wrap gap-6 justify-center">
        {/* Logical Reasoning Box */}
        <Link to="/aptitude/logic" className="w-full md:w-1/3 lg:w-1/4">
          <div className="bg-white p-6 border border-gray-300 rounded-lg shadow-lg hover:bg-gray-50 ">
            <h2 className="text-2xl font-semibold text-center">Logical Reasoning</h2>
            <p className="mt-2 text-gray-600 text-center">
              Explore various logical reasoning questions and enhance your skills.
            </p>
          </div>
        </Link>

        {/* Numerical Aptitude Box */}
        <Link to="/aptitude/numerical" className="w-full md:w-1/3 lg:w-1/4">
          <div className="bg-white p-6 border border-gray-300 rounded-lg shadow-lg hover:bg-gray-50 ">
            <h2 className="text-2xl font-semibold text-center">Numerical Aptitude</h2>
            <p className="mt-2 text-gray-600 text-center">
              Solve numerical aptitude questions to improve your calculation skills.
            </p>
          </div>
        </Link>

        {/* Verbal Ability Box */}
        <Link to="/aptitude/verbal" className="w-full md:w-1/3 lg:w-1/4">
          <div className="bg-white p-6 border border-gray-300 rounded-lg shadow-lg hover:bg-gray-50 transition ease-in-out duration-300">
            <h2 className="text-2xl font-semibold text-center">Verbal Ability</h2>
            <p className="mt-2 text-gray-600 text-center">
              Test your verbal ability with various questions to enhance your language skills.
            </p>
          </div>
        </Link>

        {/* Add more headings/topics here */}
      </div>
    </div>
  );
};

export default AptitudeLearning;
